import { map } from "core-js/core/array";
import { mapGetters, mapActions } from "vuex";
export default{
    name:"tagDescription",
    data(){
        return{
            tagDescription:[],
        }
    },
    props:{
        tagobj:{
            type:Object,
            default:{}
        }
    },
    computed:{
        ...mapGetters('TagStore',['gettagDetails'])
    },
    methods:{
        ...mapActions('TagStore',['FETCH_TAGS']),
       viewmore()
        {
            this.FETCH_TAGS(this.tagobj),
            console.log(this.gettagDetails);
        },

    }

}
